import React from 'react';

function Card({ card }) {
  if (!card || !card.value || !card.suit) {
    return <p>Aucune carte n'a été tirée.</p>; // Message si la carte est undefined
  }

  return (
    <div className="card">
      <p>{card.value} de {card.suit}</p>
    </div>
  );
}

export default Card;
